import Modal from "../../UI/Modal";
import  "./Checkout.module.css";

const Checkout = (props) => {
  return (
      <form >
        <div className='form-control'>
          <label htmlFor="name">Your Name</label>
          <input
            type="text"
            id="name"
          />
        </div>
        <div className="form-actions">
          <button >Order</button>
        </div>
      </form>
  );
};

export default Checkout;
